    "terms_of_use" : MessageLookupByLibrary.simpleMessage("Se Clinical Informatics Research Group (CIRG), nan the University of Washington, ki fè app sa a pou ede moun, tankou oumenm, ki gendwa gen enkyetid sou enfeksyon avèk Coronavirus (COVID-19). Oubyen, moun ki senpleman bezwen konnen ki miyè jan pou yo \"rete lakay\" pa yo a. Pwofesè, etidyan, epi anplwaye CIRG ap fè travay sa a pou ede moun nan kominote inivèsite a, lokal yo, rejyon an, peyi a, epi entènasyonal tou.\n\nUniversity of Washington (UW) pa responsab pou egzatitid epi sekirite enfòmasyon ki nan app la. UW pa devlope sistèm lan, li pa jere pi, epi li pa andose l.\n\nLi enpòtan pou nou pou enfòmasyon ou yo rete prive. N ap fè tout posib nou pou kenbe enfòmasyon medikal ou yo prive epi sekirize nan sistèm nou an, men nou ofri app sa a san okenn asirans oubyen garanti.\n\nNou pa suiv enfòmasyon lokalizasyon GPS ou gen nan telefòn ou an. Nou pa konekte adrès IP ou a avèk enfòmasyon ou yo. Nou itilize lojisyèl analitik elektwonik (Matomo) pou konprann kijan itilizatè itilize app la epi nou pral gade kijan yo konekte si n kwè gen yon esè pou konpwomèt sekirite sistèm nou yo.\n\nOu ka itilize app la san w pa mete okenn enfòmasyon pèsonèl depi w pase sou tout kesyon ki mande pou yo. Sistèm lan ap gen mwens chans pou l pèsonalize sa w bezwen, men pa gen pwoblèm ak sa pou nou. Nou vle pou w sèvi avèk app sa a jan oumenm ou pi plis alèz fè sa.\n\nSeksyon resous nan app la disponib pou tout moun. Pa gen pwoblèm pou w sèvi avèk fonksyon sa a san w pa gen okenn itilizatè epi san w pa konekte.\n\nSi w chwazi pou w gen yon non itilizatè, konnen w ap gen pou w ban nou yon adrès imèl, men w gendwa ban n yon move adrès imèl tou si w vle. Si mete yon move adrès imèl ou pa p ka alò retabli adrès imèl ou a, men tout lòt bagay nan app la ap toujou mache menm jan. Ou ka fè mizajou adrès imèl ou a pi devan, men non itilizatè ou a pa p ka chanje.\n\nGade tanpri paj pwofil ou a avèk anpil atansyon. N esplike sou paj sa a itili